event.script:
/*
                This listbox object will populate two columns with
                data from a data connection. sDataConnectionName -
                name of the data connection to get the data from.
                Note the data connection will appear in the Data
                View. sColHiddenValue - this is the hidden value
                column of the listbox. Specify the table column
                name used for populating. sColDisplayText - this is
                the display text column of the listbox. Specify the
                table column name used for populating. These
                variables must be assigned for this script to run
                correctly. Replace <value> with the correct
                value. */ var sDataConnectionName =
                "<value>"; // example - var
                sDataConnectionName = "MyDataConnection"; var
                sColHiddenValue = "<value>"; // example - var
                sColHiddenValue = "MyIndexValue"; var
                sColDisplayText = "<value>"; // example - var
                sColDisplayText = "MyDescription" // Search for
                sourceSet node which matchs the DataConnection name
                var nIndex = 0;
                while(xfa.sourceSet.nodes.item(nIndex).name !=
                sDataConnectionName) { nIndex++; } var oDB =
                xfa.sourceSet.nodes.item(nIndex).clone(1);
                oDB.open(); oDB.first(); // Search node with the
                class name "command" var nDBIndex = 0;
                while(oDB.nodes.item(nDBIndex).className !=
                "command") { nDBIndex++; } // Backup the original
                settings before assigning BOF and EOF to stay var
                sBOFBackup =
                oDB.nodes.item(nDBIndex).query.recordSet.getAttribute("bofAction");
                var sEOFBackup =
                oDB.nodes.item(nDBIndex).query.recordSet.getAttribute("eofAction");
                oDB.nodes.item(nDBIndex).query.recordSet.setAttribute("stayBOF",
                "bofAction");
                oDB.nodes.item(nDBIndex).query.recordSet.setAttribute("stayEOF",
                "eofAction"); // Clear the list this.clearItems();
                // Search for the record node with the matching
                Data Connection name nIndex = 0;
                while(xfa.record.nodes.item(nIndex).name !=
                sDataConnectionName) { nIndex++; } var oRecord =
                xfa.record.nodes.item(nIndex); // Find the value
                node var oValueNode = null; var oTextNode = null;
                for(var nColIndex = 0; nColIndex <
                oRecord.nodes.length; nColIndex++) {
                if(oRecord.nodes.item(nColIndex).name ==
                sColHiddenValue) { oValueNode =
                oRecord.nodes.item(nColIndex); }
                if(oRecord.nodes.item(nColIndex).name ==
                sColDisplayText) { oTextNode =
                oRecord.nodes.item(nColIndex); } }
                while(!oDB.isEOF()) { this.addItem(oTextNode.value,
                oValueNode.value); oDB.next(); } // Restore the
                original settings
                oDB.nodes.item(nDBIndex).query.recordSet.setAttribute(sBOFBackup,
                "bofAction");
                oDB.nodes.item(nDBIndex).query.recordSet.setAttribute(sEOFBackup,
                "eofAction"); // Close connection
                oDB.close();

